/**
 * Conventions:
 * _message: is for unformatted text that will be shown as-is to
 * the user.
 * _text: is for text that will appear in the UI, possibly with
 * decorations, e.g., $(x) uses the https://octicons.github.com/ and should not
 * be localized
 *
 * If ommitted, we will assume _message.
 */
export declare const messages: {
    session_language_server_error_text: string;
    session_started_text: string;
    session_terminated_text: string;
    no_log_file_text: string;
    incorrect_log_levels_text: string;
    unable_to_retrieve_org_info: string;
    heap_dump_error: string;
    heap_dump_error_wrap_up_text: string;
    fetching_heap_dump: string;
    malformed_log_line: string;
    reconcile_heapdump_error: string;
};
